package com.snaps.common.data.img;import android.os.Parcel;import android.os.Parcelable;//�ъ쭊���ъ쭊public class MyKakaoStoryNameCardData implements Parcelable {  	public String KAKAOPROFILE_IMAGE_DATA = "";	public String KAKAOPROFILE_THUMBNAIL_IMAGE_DATA = "";	public String KAKAOBACKGROUND_IMAGE_DATA = "";	public String KAKAO_DISPLAY_NAME = "";		public MyKakaoStoryNameCardData() {    }		@Override	public void writeToParcel(Parcel dest, int flags) {		dest.writeString(KAKAOPROFILE_IMAGE_DATA);		dest.writeString(KAKAOPROFILE_THUMBNAIL_IMAGE_DATA);		dest.writeString(KAKAOBACKGROUND_IMAGE_DATA);		dest.writeString(KAKAO_DISPLAY_NAME);	}		private void readFromParcel(Parcel in){		KAKAOPROFILE_IMAGE_DATA = in.readString();		KAKAOPROFILE_THUMBNAIL_IMAGE_DATA = in.readString();		KAKAOBACKGROUND_IMAGE_DATA = in.readString();			KAKAO_DISPLAY_NAME = in.readString();	}		public MyKakaoStoryNameCardData(Parcel in) {		readFromParcel(in);	}	    	@Override	public int describeContents() {		return 0;	}		@SuppressWarnings("rawtypes")	public static final Parcelable.Creator CREATOR = new Parcelable.Creator() {        public MyKakaoStoryNameCardData createFromParcel(Parcel in) {             return new MyKakaoStoryNameCardData(in);       }       public MyKakaoStoryNameCardData[] newArray(int size) {            return new MyKakaoStoryNameCardData[size];       }   };}